-- ----------------------------
-- Table structure for hanzi
-- ----------------------------
DROP TABLE IF EXISTS `hanzi`;
CREATE TABLE `hanzi` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `hanzi` varchar(20) NOT NULL COMMENT '汉字',
  `initial` char(1) NOT NULL COMMENT '拼音 首字母',
  `pinyin` varchar(200) NOT NULL COMMENT '拼音无读音',
  `jt_bushou` varchar(20) DEFAULT NULL COMMENT '简体字-部首',
  `jt_bs_bihua` int(10) DEFAULT NULL COMMENT '简体字-部首笔画',
  `jt_zongbihua` int(10) DEFAULT NULL COMMENT '简体字-总笔画',
  `ft_bushou` varchar(20) DEFAULT NULL COMMENT '繁体字-部首',
  `ft_bs_bihua` int(10) DEFAULT NULL COMMENT '繁体字-部首笔画',
  `ft_zongbihua` int(10) DEFAULT NULL COMMENT '繁体字-总笔画',
  `kx_hanzi` varchar(20) DEFAULT NULL COMMENT '康熙字典-汉字',
  `kx_bihua` int(10) DEFAULT NULL COMMENT '康熙字典-笔画',
  `shurufa_wubi86` varchar(20) DEFAULT NULL COMMENT '输入法-五笔86',
  `shurufa_wubi98` varchar(20) DEFAULT NULL COMMENT '输入法-五笔98',
  `shurufa_cangji` varchar(20) DEFAULT NULL COMMENT '输入法-仓颉',
  `unicode` varchar(20) DEFAULT NULL COMMENT 'UniCode值',
  `gb_no` varchar(20) DEFAULT NULL COMMENT '国标-编码',
  `wuxing` varchar(20) DEFAULT NULL COMMENT '五行所属',
  `jixiong` varchar(20) DEFAULT NULL COMMENT '吉凶寓意',
  `xingming` varchar(20) DEFAULT '' COMMENT '姓名学',
  `is_changyong` varchar(20) DEFAULT '' COMMENT '是常用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24098 DEFAULT CHARSET=utf8mb4;

